import { Container } from "react-bootstrap";


function App() {
  return (
    <>
    <Header></Header>
    <main>
  <Container>
	<h1>Welcome To Techinfoyt</h1>
  <Homescreen />
  </Container>
  </main>

  <Footer/>
	</>
  );
}

export default App;
